import { useEffect,useState} from "react";
const Login=()=>
{
      return(
        <form >
          <div class>
          <input
           type="text"
           placeholder="Enter your email"
          />
          </div>
          <input
          type="text"
          placeholder="Enter the password"
          />
        </form>
      )
}
export default Login;
